define([],function(){var e={init:function(){console.log("service");var e=$("#j_service_post");e.submit(function(t){t.preventDefault();var a=$('<div class="form_status clearfix"></div>');$.ajax({url:$(this).attr("action"),type:$(this).attr("method"),dataType:"json",data:e.serialize(),beforeSend:function(){e.append(a.html('<p><i class="fa fa-spinner fa-spin"></i> 表单正在提交中...</p>').fadeIn())}}).done(function(t){1==t.status?(a.html('<p class="text-success"><i class="fa fa-check"></i>'+t.msg+"</p>").delay(3e3).fadeOut(),setTimeout(function(){e[0].reset()},1e3)):a.html('<p class="text-danger"><i class="fa fa-close"></i>'+t.msg+"</p>").delay(3e3).fadeOut()})})}};return e});